import React from "react";
import { Link, useParams } from "react-router-dom";

function AddCardsBtn() {
  const { deckId } = useParams();
  return (
    <Link
      to={`/decks/${deckId}/cards/new`}
      type="button"
      className="btn btn-primary"
    >
      Add cards
    </Link>
  );
}

export default AddCardsBtn;
